import React from 'react';
import {Link} from 'react-router-dom'
const Navbar = ({title}) =>{

        return (
            <nav className="navbar  bg-primary">
            <h1>
             {title}
            </h1>
            <ul>
                <li>
                <Link to=''>Customer Information</Link>
                </li>
                <li>
                <Link to=''>Eligibility Check</Link>
                </li>
            </ul>
          </nav>
        )

}
 Navbar.defaultProps={
  title:'SaskFundApp'
};
export default Navbar
